import React from 'react';

const MapDisplayComponent = ({ htmlContent }) => {
  return (
    <div>
      <h1>地图显示</h1>
      <div dangerouslySetInnerHTML={{ __html: htmlContent }} />
    </div>
  );
};

export default MapDisplayComponent;
